import React from "react";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import AboutUs from "./components/AboutUs/AboutUs";
import Home from "./Home";
function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/" >
        <Home />
        </Route>
        <Route path="/AboutUs" component={AboutUs} />
      </Switch>
    </Router>
  );
}

export default App;
